// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CharityDonation {
    // Struct for each donation
    struct Donation {
        address donor;
        string donorName;
        uint256 amount;
        string charity;
        uint256 timestamp;
    }

    // Array to store donations
    Donation[] public donations;

    // Mapping to store top donors
    mapping(address => uint256) public donorAmounts;

    // Event to log each donation
    event DonationMade(
        address indexed donor,
        string donorName,
        uint256 amount,
        string charity,
        uint256 timestamp
    );

    // Function to make a donation
    function makeDonation(string memory donorName, string memory charity) public payable {
        require(msg.value > 0, "Donation must be greater than 0");

        // Log the donation details
        donations.push(Donation(msg.sender, donorName, msg.value, charity, block.timestamp));
        donorAmounts[msg.sender] += msg.value;

        emit DonationMade(msg.sender, donorName, msg.value, charity, block.timestamp);
    }

    // Function to get top donors
    function getTopDonors() public view returns (Donation[] memory) {
        uint256 topCount = donations.length < 5 ? donations.length : 5;
        Donation[] memory topDonors = new Donation[](topCount);
        for (uint256 i = 0; i < topCount; i++) {
            topDonors[i] = donations[i];
        }
        return topDonors;
    }

    // Function to simulate mining, requires a minimum amount or top donor status
    function simulateMining() public view returns (bool) {
        return donorAmounts[msg.sender] >= 1 ether;
    }
}
